import React from 'react'

const Home = (props) => {
    console.log(props)
    const go=()=>{
        props.history.push({pathname:'/game',state:{...props.location.state,state1:'this is 1'}})
    }
    return (
        <div className="App">
            <button onClick={go}>to game</button>
        </div>
    )
}

export default Home
